import Card  from "./Card";
function Tours ({tours,}){
    return (
        <div>

            <div>
                <h2>Plan With Abhi </h2>
            </div>

            <div>
                {
                    tours.map((tour)=>{
                        return
                            <card {...tour} removeTour={removeTour}></card>
                    })
                }
            </div>
        </div>
    );
}
export default Tours ;
